import React from "react";
const Navigation = () => {
  return (
    <nav style={{ display: "flex", justifyContent: "flex-end" }}>
      <p className="f3 link dim white underline pa3 pointer"> Sign out</p>
    </nav>
  );
};
export default Navigation;
